indices_to_check = [14, 44, 59, 104, 119]

def print_stab(idx):
    s = stabilizers[idx]
    print(f"Index {idx}:")
    print(s)
    # Find active indices
    active = []
    for i, char in enumerate(s):
        if char != 'I':
            active.append(f"{i}:{char}")
    print("Active:", ", ".join(active))

for idx in indices_to_check:
    print_stab(idx)
